import React from "react";
import { Link, useNavigate } from "react-router-dom";
import Navbar from "./Navbar";
import { googleLogout } from "@react-oauth/google";
import '../App.css'

function Common() {
  let navigate = useNavigate();

  const logout = () => {
    googleLogout({});
    navigate("/")
  };

  const goToAprcl = () => {
    navigate("/aprcl");
  };

  const goToGoal = () => {
    navigate("/goal");
  }

